import React, { Component } from 'react'

class Queries extends Component {
  render() {
    return (
      <div>
            <div className = "btn btn-info mt-2 ml-2" onClick ={() => {
                    this.setState(prevState => ({
                        displayGroups: !prevState.displayGroups
                        
                    }))}}>
                    
                    Queries
                
            </div>   
                 
                                   
            
      </div>
    )
  }
}

export default Queries;
